import styled from "styled-components"

const Wrapper = styled.div`
    display: flex;
    align-items: center;
`
const Button = styled.button`
    width: 420px;
    height: 20px;
    font-weight: 600;
    background-color:#F7E600;
    color: #3A1D1D;
    padding: 10px;
    margin: 40px 10px 10px 10px;
    border: none;
    font-size: 17px;
    border-radius: 5px;
    &:hover{
        opacity: 0.92;
    }
`



export default function KakaoLoginButtin(){
    return(
        <Wrapper>
                <img src={process.env.PUBLIC_URL + '/image/kakao.png'} style={{width:"100%",height:"100%"}}><Button/></img>
        </Wrapper>
    )
}
